  cpee:description: "<?xml version=\"1.0\"?>\n<description xmlns=\"http://cpee.org/ns/description/1.0\">\n
    \ <manipulate id=\"a2\" label=\"Initialize Time\">data.local_clock = Time.now\ndata.start
    = Time.now.to_i</manipulate>\n  <call id=\"a7\" endpoint=\"dtcget\">\n    <parameters>\n
    \     <label>Read</label>\n      <arguments/>\n    </parameters>\n    <code>\n
    \     <prepare/>\n      <finalize output=\"result\"/>\n      <update output=\"result\">if
    result['partial']\n  data.data[result['partial']['group'] + '/' + result['partial']['name']]
    = result['partial']['value']\nend\nif result['full']\n  data.data = result['full']\nend</update>\n
    \     <rescue output=\"result\"/>\n    </code>\n    <annotations>\n      <_generic/>\n
    \     <_timing>\n        <_timing_weight/>\n        <_timing_avg/>\n        <explanations/>\n
    \     </_timing>\n      <_shifting>\n        <_shifting_type>Duration</_shifting_type>\n
    \     </_shifting>\n      <_context_data_analysis>\n        <probes/>\n        <ips/>\n
    \     </_context_data_analysis>\n      <report>\n        <url/>\n      </report>\n
    \     <_notes>\n        <_notes_general/>\n      </_notes>\n    </annotations>\n
    \   <documentation>\n      <input/>\n      <output/>\n      <implementation>\n
    \       <description/>\n      </implementation>\n      <code>\n        <description/>\n
    \     </code>\n    </documentation>\n  </call>\n  <parallel wait=\"1\" cancel=\"last\">\n
    \   <parallel_branch pass=\"\" local=\"\">\n      <call id=\"a5\" endpoint=\"dtcget\">\n
    \       <parameters>\n          <label>Read</label>\n          <arguments>\n            <many>true</many>\n
    \         </arguments>\n        </parameters>\n        <code>\n          <prepare/>\n
    \         <finalize output=\"result\"/>\n          <update output=\"result\">if
    result['partial']\n  data.data[result['partial']['group'] + '/' + result['partial']['name']]
    = result['partial']['value']\nend\nif result['full']\n  data.data = result['full']\nend</update>\n
    \         <rescue output=\"result\"/>\n        </code>\n        <annotations>\n
    \         <_generic/>\n          <_timing>\n            <_timing_weight/>\n            <_timing_avg/>\n
    \           <explanations/>\n          </_timing>\n          <_shifting>\n            <_shifting_type>Duration</_shifting_type>\n
    \         </_shifting>\n          <_context_data_analysis>\n            <probes/>\n
    \           <ips/>\n          </_context_data_analysis>\n          <report>\n
    \           <url/>\n          </report>\n          <_notes>\n            <_notes_general/>\n
    \         </_notes>\n        </annotations>\n        <documentation>\n          <input/>\n
    \         <output/>\n          <implementation>\n            <description/>\n
    \         </implementation>\n          <code>\n            <description/>\n          </code>\n
    \       </documentation>\n      </call>\n    </parallel_branch>\n    <parallel_branch
    pass=\"\" local=\"\">\n      <loop mode=\"post_test\" condition=\"data.duration
    &lt; 20\">\n        <_probability>\n          <_probability_min/>\n          <_probability_max/>\n
    \         <_probability_avg/>\n        </_probability>\n        <call id=\"a4\"
    endpoint=\"timeout\">\n          <parameters>\n            <label>Wait</label>\n
    \           <arguments>\n              <timeout>1</timeout>\n            </arguments>\n
    \         </parameters>\n          <code>\n            <prepare/>\n            <finalize
    output=\"result\">data.duration = Time.now.to_i - data.start</finalize>\n            <update
    output=\"result\"/>\n            <rescue output=\"result\"/>\n          </code>\n
    \         <annotations>\n            <_generic/>\n            <_timing>\n              <_timing_weight/>\n
    \             <_timing_avg/>\n              <explanations/>\n            </_timing>\n
    \           <_shifting>\n              <_shifting_type>Duration</_shifting_type>\n
    \           </_shifting>\n            <_context_data_analysis>\n              <probes/>\n
    \             <ips/>\n            </_context_data_analysis>\n            <report>\n
    \             <url/>\n            </report>\n            <_notes>\n              <_notes_general/>\n
    \           </_notes>\n          </annotations>\n          <documentation>\n            <input/>\n
    \           <output/>\n            <implementation>\n              <description/>\n
    \           </implementation>\n            <code>\n              <description/>\n
    \           </code>\n          </documentation>\n        </call>\n        <choose
    mode=\"exclusive\">\n          <alternative condition=\"data.data['actuators/heat']\">\n
    \           <manipulate id=\"a1\" label=\"Heat\">time = Time.now - Time.parse(data.local_clock)\ny
    = data.data['sensors/temperature'] + (\n  data.data['actuators/energy'] * time\n)
    / (\n  data.data['environment/mass'] * data.data['environment/capacity']\n)\ny
    = 100 if y &gt; 100\ndata.new_temperature = y\ndata.local_clock = Time.now</manipulate>\n
    \           <_probability>\n              <_probability_min/>\n              <_probability_max/>\n
    \             <_probability_avg/>\n            </_probability>\n          </alternative>\n
    \         <otherwise>\n            <manipulate id=\"a6\" label=\"Cool\">time =
    Time.now - Time.parse(data.local_clock)\ny = data.data['environment/ambient_temperature']
    + \n    ( \n      data.data['sensors/temperature'] - \n      data.data['environment/ambient_temperature']\n
    \   ) * Math.exp(-1 * time * data.data['environment/cooling_coefficient'])\ndata.new_temperature
    = y\ndata.local_clock = Time.now</manipulate>\n          </otherwise>\n        </choose>\n
    \       <choose mode=\"exclusive\">\n          <alternative condition=\"data.new_temperature
    != data.data['sensors/temperature']\">\n            <call id=\"a3\" endpoint=\"tempset\">\n
    \             <parameters>\n                <label>Set Temperature</label>\n                <arguments>\n
    \                 <float>!data.new_temperature</float>\n                </arguments>\n
    \             </parameters>\n              <annotations>\n                <_generic/>\n
    \               <_timing>\n                  <_timing_weight/>\n                  <_timing_avg/>\n
    \                 <explanations/>\n                </_timing>\n                <_shifting>\n
    \                 <_shifting_type>Duration</_shifting_type>\n                </_shifting>\n
    \               <_context_data_analysis>\n                  <probes/>\n                  <ips/>\n
    \               </_context_data_analysis>\n                <report>\n                  <url/>\n
    \               </report>\n                <_notes>\n                  <_notes_general/>\n
    \               </_notes>\n              </annotations>\n              <documentation>\n
    \               <input/>\n                <output/>\n                <implementation>\n
    \                 <description/>\n                </implementation>\n              </documentation>\n
    \           </call>\n            <_probability>\n              <_probability_min/>\n
    \             <_probability_max/>\n              <_probability_avg/>\n            </_probability>\n
    \         </alternative>\n          <otherwise/>\n        </choose>\n      </loop>\n
    \   </parallel_branch>\n  </parallel>\n</description>\n"
